async () => {
  const type = "other";
  const lead = await CRICKET_API.callApi({
    endpoint: "lead",
    method: "POST",
    data: {
      ...LEAD,
      type,
    },
  }).then((r) => r.data);
  const manager = {
    ...lead,
    managerFirst: TEST_DATA_GENERATOR.firstName(),
    managerLast: TEST_DATA_GENERATOR.lastName(),
    managerEmail: TEST_DATA_GENERATOR.email(),
  };
  const response = await CRICKET_API.callApi({
    endpoint: `lead/${lead.id}`,
    method: "PUT",
    data: {
      ...manager,
      complete: true,
    },
  });

  expect(response).toHaveStatusCode(200);
  expect(response.duration).toHaveResponseTimeBelow(10);
  expect(response.data).toStrictEqual(manager);
  expect(response.data).toMatchSchema("response");
};

